import React from 'react'
import { connect } from 'react-redux'

interface ViewProps {
  portalQueryParam: string,
}

export class Query extends React.Component <ViewProps, any> {
  constructor(props: any) {
    super(props);
    this.state = {
      portalQueryParam: "",
    }
  }

  public static defaultProps = {
    portalQueryParam: "",
  }

  render() {
    return (
      <div className="useritemsview">
         <form>
            <label htmlFor="fname">First name:</label>
            <input type="text" id="fname" name="fname"></input>
            <label htmlFor="lname">Last name:</label>
            <input type="text" id="lname" name="lname"></input>
            <input type="submit" value="Query"></input>
          </form> 
      </div>
    )
  }
}

const mapStateToProps = ({ user: { username, userItems }}:any) => ({
  username,
  userItems,
})
const mapDispatchToProps = dispatch => ({
  query() {
    return () => {
      dispatch(actions.query)
    }
  }
})

export default connect(mapStateToProps, mapDispatchToProps)(Query)
